import * as GA from "react-ga";

declare module "react-ga" {
    export function ga(...args: any[]): any;
}

/**
 * Initialize
 * 
 * @export
 * @param id 
 * @param type 
 * @param version 
 */
export function initialize(id: string, type: "web" | "app", version: string): void {
    GA.initialize(id, {
        gaOptions: {
            cookieDomain: ".ramblechat.com"
        }
    });
    GA.set({
        appName: "Ramble-Portal",
        appId: "com.ramblechat.portal",
        appVersion: version,
        dataSource: type,
        // We don't want to track referrer in portal, only for signup
        referrer: window.location.origin
    });
}

/**
 * Tracks page view
 * 
 * @export
 * @param path 
 * @param title 
 */
export function trackPageView(path: string, title: string): void {
    GA.set({
        page: path,
        title: title
    });
    GA.pageview(path);
}

export function trackSignup(referrer?: string): void {
    // Need to use raw method from GA since we're overriding referrer here
    GA.ga("send", "pageview", "/signup", {
        page: "/signup",
        title: "Signup",
        referrer: referrer || document.referrer
    });
}

/**
 * Track event
 * 
 * @export
 * @param args 
 */
export function trackEvent(args: GA.EventArgs): void {
    GA.event(args);
}

export const Categories = {
    User: "User"
};

// Type definitions for react-ga 2.1
// Project: https://github.com/react-ga/react-ga
// Definitions by: Tim Aldridge <https://github.com/telshin>
// Definitions: https://github.com/DefinitelyTyped/DefinitelyTyped

export interface EventArgs {
    category: string;
    action: string;
    label?: string;
    value?: number;
    nonInteraction?: boolean;
}

export interface GaOptions {
    name?: string;
    clientId?: string;
    sampleRate?: number;
    siteSpeedSampleRate?: number;
    alwaysSendReferrer?: boolean;
    allowAnchor?: boolean;
    cookieName?: string;
    cookieDomain?: string;
    cookieExpires?: number;
    legacyCookieDomain?: string;
    legacyHistoryImport?: boolean;
    allowLinker?: boolean;
    userId?: string;
}

export interface InitializeOptions {
    debug?: boolean;
    titleCase?: boolean;
    gaOptions?: GaOptions;
}

export interface FieldsObject {
    [i: string]: any;
}

export interface TimingArgs {
    category: string;
    variable: string;
    value: number;
    label?: string;
}

export interface Plugin {
    require(name: string, options: any): void;
    execute(pluginName: string, action: string, actionTypeOrPayload: string|any, payload?: any): void;
}

export interface OutboundLinkArgs {
    label: string;
}

export function initialize(trackingCode: string, options?: InitializeOptions): void;
export function ga(): any;
export function set(fieldsObject: FieldsObject): void;
export function send(fieldsObject: FieldsObject): void;
export function pageview(path: string): void;
export function modalview(name: string): void;
export function timing(args: TimingArgs): void;
export function event(args: EventArgs): void;
export function exception(fieldsObject: FieldsObject): void;
export const plugin: Plugin;
export function outboundLink(args: OutboundLinkArgs, hitCallback: () => void): void;

import { autobind } from "core-decorators";
import * as React from "react";
import { connect } from "react-redux";
import { RouteComponentProps } from "react-router-dom";
import { RootState } from "../../redux/modules/index";
import * as Analytic from "../../utils/Analytic";
import { SignupFormContainer } from "../forms/SignupForm";

/**
 * Component properties
 */
export interface SignupProps extends RouteComponentProps<void> {
    /**
     * Invite code
     */
    inviteCode?: string;
}

/**
 * Signup form
 */
export class Signup extends React.PureComponent<SignupProps, void> {
    public componentDidMount(): void {
        Analytic.trackSignup();
    }
    /**
     * Render
     */
    public render(): JSX.Element {
        const { inviteCode } = this.props;
        return (
            <SignupFormContainer
                inviteCode={inviteCode}
                onSuccessSignup={this.onSignupSuccess}
                onSignupFailed={this.onSignupFailed}
            />
        );
    }

    /**
     * Signup was successful
     * 
     * @protected
     */
    @autobind
    protected onSignupSuccess(): void {
        Analytic.trackEvent({
            category: Analytic.Categories.User,
            action: "Success Signup",
        });
        this.props.history.push("/");
    }

    /**
     * Signup was failed
     * 
     * @protected
     */
    @autobind
    protected onSignupFailed(): void {
        Analytic.trackEvent({
            category: Analytic.Categories.User,
            action: "Failed Signup",
        });
    }
}

/**
 * State mapper
 * 
 * @param state
 * @param ownProps
 * @returns 
 */
/* istanbul ignore next */
function mapStateToProps(state: RootState, ownProps: RouteComponentProps<void>): SignupProps {
    return {
        ...ownProps,
        inviteCode: ownProps.location.query.invite
    };
}

export const SignupContainer = connect(mapStateToProps)(Signup);
